import React, {useEffect, useState} from 'react';
import Personajes from './assets/componentes/Personajes';
import Navegacion from './assets/componentes/Navegacion'
import {BrowserRouter, Routes, Route, Link} from 'react-router-dom'

function App() {

  const [characters, setCharacters] = useState ([]);

  const iniUrl = 'https://rickandmortyapi.com/api/character'

  const infor = (url) =>{ fetch(url)
  .then (response => response.json())
  .then (data => setCharacters (data.results))
  .then (error => console.log(error))
  }

  useEffect (() =>{
      infor (iniUrl);
  }, [])


  return (
    <>
    <Navegacion brand = "Rick and morty"/>
      <div>
        <h1>Hola mundo</h1>
      </div>


      <BrowserRouter>    

      <button><Link to= 'personajes'></Link></button>

      <Routes>  
       <Route path='/personajes' element = {<Personajes personaje = {characters} />}/>       
      </Routes>
      </BrowserRouter>




   </>
  );
}

export default App;
